import React from "react";
import Log from "./Log";
import { Routes, Route } from "react-router-dom";
import Nav from "./Nav";
import Home from "./Home";
import Bgmi from "./Bgmi";
import FF from "./FF";
import Pr from "./Pr";
import Um from "./Um";
import Wit from "./Wit";
import Dep from "./Dep";
import Result from "./Result";
import Bsolo1r from "./Bsolo1r";
import Bsolo2r from "./Bsolo2r";
import Bsquadr from "./Bsquadr";
import Fsolo1r from "./Fsolo1r";
import Fsolo2r from "./Fsolo2r";
import Fsquadr from "./Fsquadr";
function App() {
  const bs1 = {
    type: "SOLO",
    map: "ERANGLE",
    date: "01/01/2004",
    time: "10:00 am",
  };
  const bs2 = {
    type: "SOLO",
    map: "ERANGLE",
    date: "01/01/2004",
    time: "11:00 am",
  };
  const bsd = {
    type: "SQUAD",
    map: "ERANGLE",
    date: "01/01/2004",
    time: "12:00 am",
  };
  const fs1 = {
    type: "SOLO",
    map: "BERMUDA",
    date: "01/01/2004",
    time: "10:00 am",
  };
  const fs2 = {
    type: "SOLO",
    map: "BERMUDA",
    date: "01/01/2004",
    time: "11:00 am",
  };
  const fsd = {
    type: "SQUAD",
    map: "BERMUDA",
    date: "01/01/2004",
    time: "12:00 am",
  };
  return (
    <>
      <Nav />
      <Routes>
        <Route path="/" element={<Log />}></Route>
        <Route element={<Pr />}>
          <Route path="/home" element={<Home />}></Route>
          <Route
            path="/bgmi"
            element={<Bgmi bs1={bs1} bs2={bs2} bsd={bsd} />}
          ></Route>
          <Route
            path="/ff"
            element={<FF fs1={fs1} fs2={fs2} fsd={fsd} />}
          ></Route>
          <Route
            path="/um"
            element={
              <Um bs1={bs1} bs2={bs2} bsd={bsd} fs1={fs1} fs2={fs2} fsd={fsd} />
            }
          ></Route>
          <Route path="/result" element={<Result />}></Route>
          <Route path="/bsolo1r" element={<Bsolo1r />}></Route>
          <Route path="/bsolo2r" element={<Bsolo2r />}></Route>
          <Route path="/bsquadr" element={<Bsquadr />}></Route>
          <Route path="/fsolo1r" element={<Fsolo1r />}></Route>
          <Route path="/fsolo2r" element={<Fsolo2r />}></Route>
          <Route path="/fsquadr" element={<Fsquadr />}></Route>
          <Route path="/deposit" element={<Dep />}></Route>
          <Route path="/withdraw" element={<Wit />}></Route>
        </Route>
      </Routes>
    </>
  );
}
export default App;
